import React from "react";

import search from "../../data/search.json";
import "./SearchList.css";

const SearchList = () => {
  return (
    <div>
      {search.map((item) => (
        <div>
          <img src={item.image_url}></img>
          <div>
            <h1>{item.name}</h1>
          </div>
        </div>
      ))}
    </div>
  );
};

export default SearchList;
